window.bookSummaryJSON = "<p><b>Brought to you by Penguin.</b><br> <br> <b>Over 1 million Discworld audiobooks sold – discover the extraordinary universe of Terry Pratchett’s Discworld like never before</b><br> <br> <i>'Holy Wood is a different sort of place. People act differently here. Everywhere else the most important things are gods or money or cattle. Here, the most important thing is to be important.'</i><br> <br> Cameras roll, for the first time, on the Discworld when alchemists discover the excitement of the silver screen. But what is the dark secret of Holy Wood hill? As the cliches of Tinsel Town pour into the world, it's up to the Disc's first film stars to find out . . .<br> <br> Join <b>Victor Tugelbend</b> ('Can't sing. Can't dance. Can handle a sword a little') and<b> Theda Withel </b>('I come from a little town you've probably never heard of') as they battle the forces of evil and cinema advertising.<br> <br> <b>They're about to discover that the magic of the silver screen might be powerful enough to put an end to, well, everything.</b><br> <br> <i>The Discworld novels can be listened to in any order but </i><b><i>Moving Pictures </i></b><i>is a standalone novel.</i><br> <br> <b>'Cracking dialogue, compelling illogic and unchained whimsy' </b><i>Sunday Times</i></p>"; 
